After an explosion on their moon, the Klingons have an estimated 50 years before their ozone layer is completely depleted, and they all die. They have only 1 choice - to make peace with the Federation, which will mean an end to 70 years of conflict. Captain James T. Kirk and crew are called upon to help in the negotiations because of their &quot;experience&quot; with the Klingon race. Peace talks don't quite go to plan, and eventually Kirk and McCoy are tried and convicted of assassination, and sent to Rura Penthe, a snowy hard-labor prison camp. Will they manage to escape ? And will there ever be peace with the Klingons ?
